import React from "react";
import { Link } from "react-router-dom";
import Button from "../components/Button";

const games = [
  { name: "Aviator", path: "/aviator", image: "/assets/aviator.jpg" },
  { name: "CrashX", path: "/crashx", image: "/assets/crashx.jpg" },
  { name: "Spin & Win", path: "/spin", image: "/assets/spin.jpg" },
  { name: "Dice Roll", path: "/dice", image: "/assets/dice.jpg" },
];

export default function Home() {
  return (
    <div className="home-container">
      {/* Sidebar */}
      <aside className="sidebar">
        <h2 className="sidebar-title">ðŸŽ® BetX Games</h2>
        <nav className="sidebar-nav">
          {games.map((game) => (
            <Link
              key={game.name}
              to={game.path}
              className="sidebar-link"
            >
              {game.name}
            </Link>
          ))}
        </nav>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <h1 className="main-title">Play Now</h1>
        <div className="games-grid">
          {games.map((game) => (
            <div
              key={game.name}
              className="game-card"
            >
              <img
                src={game.image}
                alt={game.name}
                className="game-image"
              />
              <h2 className="game-title">{game.name}</h2>
              <Link to={game.path}>
                <Button className="play-button">Play Now</Button>
              </Link>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
}
